INSERT INTO `articulos` VALUES (1,'¿Es necesario tener una lesion para ir a Prophysio?','La respuesta es: ¡NO! Aquí también te ayudamos a prevenir una lesión para que tu nivel físico sea el mejor. ','https://prophysio.tagme.uno/public/blog_images/lesion_prophysio.PNG','2023-07-12 03:52:59',NULL),(2,'¿Que es la bursitis?','La bursitis es la inflamación de las almohadillas llenas de líquido (bolsas sinoviales) que funcionan como amortiguadores en las articulaciones, suele ocurrir en las articulaciones que hacen movimientos frecuentes y repetitivos.','https://prophysio.tagme.uno/public/blog_images/bursitis.PNG','2023-07-12 03:57:11',NULL),(3,'¿Como prevenir el dolor lumbar?','Apoya la espalda al sentarte, mantén posturas adecuadas al estar sentado o acostado, no cargues objetos pesados, realizar ejercicio físico','https://prophysio.tagme.uno/public/blog_images/dolor_lumbar.PNG','2023-07-12 03:57:38',NULL),(4,'Factores que generan dolor de rodillas','Sobrepeso, Falta de flexibilidad y fuerza muscular, Actividades deportivas de alto impacto, Lesiones previas','https://prophysio.tagme.uno/public/blog_images/rodillas.PNG','2023-07-12 04:00:59',NULL),(5,'Sedentarismo','El sedentarismo es las carencia de actividad física fuerte como el deporte, lo que por lo general pone al organismo humano en situación vulnerable ante enfermedades especialmente cardiacas y sociales.','https://prophysio.tagme.uno/public/blog_images/sedentarismo.PNG','2023-07-12 04:01:49',NULL);
