INSERT INTO `servicios` VALUES (6,'2023-03-17 16:55:35','2023-03-17 16:55:35','Fisioterapia Deportiva','20230317-105535-deportiva.jpg','Señor con una pelota','La fisioterapia deportiva es una subespecialidad que se encarga de atender las necesidades fisioterapeutas de personas que realizan actividad física constante, sea por salud, de forma amateur, practiquen un deporte profesionalmente o realicen actividades'),(7,'2023-03-17 16:56:29','2023-03-17 16:56:29','Fisioterapia Traumatológica y Ortopédica','20230317-105629-Fisioterapia Traumatológica y Ortopédica.jpg','Señor con vendaje en la rodilla','La fisioterapia traumatológica y ortopédica es un área especializada encargada de diagnosticar, evaluar y tratar lesiones de carácter músculo-esqueléticas. Este tipo de lesiones ocurren en tejidos blandos, músculos, huesos, nervios y articulaciones.'),(8,'2023-03-17 16:57:23','2023-03-17 16:57:23','Fisioterapia Geriátrica','20230317-105723-Geriatrica.jpg','Un abuelito en terapia','La fisioterapia geriátrica es una disciplina específica de la fisioterapia que busca adaptar las técnicas y los modos de aplicación para implementarlo en la rehabilitación de personas de la tercera edad.  Con el tiempo, el cuerpo comienza a perder fortale'),(9,'2023-03-17 17:01:40','2023-03-17 17:01:40','Terapia Pulmonar','20230317-110140-Pulmonar.png','Terapia en la parte de los pulmones','También conocida como terapia pulmonar o cardiaca, la especialidad de fisioterapia cardio-respiratoria se ocupa de diagnosticar, tratar y prevenir enfermedades del corazón y pulmón, especialmente aquellas que causan dificultad para respirar, sensación de'),(10,'2023-07-03 16:39:31','2023-07-03 16:39:31','Terapia deportiva','20230703-103931-programacion.png','Señor con vendaje en la rodilla','para los deportistas');
